-- ----------------------------
-- View structure for vw_max_fre_periodo
-- ----------------------------
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_max_fre_periodo` AS select `v`.`idind_secretaria` AS `idind_secretaria`,max(`vw`.`anio_periodo`) AS `anio_periodo`,max(`v`.`fre_periodo`) AS `fre_periodo` from (`valores` `v` join `vw_max_anio_val` `vw` on(((`vw`.`anio_periodo` = `v`.`anio_periodo`) and (`vw`.`idind_secretaria` = `v`.`idind_secretaria`)))) group by `v`.`idind_secretaria`;

